    const matchesApi = async () => {
        try {
            const responseMatches = await api.get("fixtures", { live: 'all' });
            setMatches(responseMatches);
            console.log(responseMatches);
        } catch (error) {
            console.log(error);
        }
    };

    useEffect(() => {
        matchesApi();
    }, [])

    return (
        <>
